import React, { Component } from 'react'
import './Createcomment.css'
const CreateComment=()=>{
    return(
        <div className="maincomment">
        <div className="comment">
<text>ثبت نظر کاربران</text>
        </div>
        <input className="createcommentinput"/>
        <textarea defaultValue="دیدگاه خود را بنویسید" className="createcommenttextarea" />
        <button className="createcommentbutton">ثبت نظر</button>
        </div>
    )
}
export default CreateComment;
